import "./workCardstyle.css"

const Work = () => {

  return (
    <div className="work-container">
            <h1 className="project-heading">Projects</h1>
            <div className="project-container">
            {WorkCardData.map((val,index) =>{
                return(
                    <WorkCard
                    key={ind}
                    imgsrc = {val.imgsrc}
                    title = {val.title}
                    text = {val.text}
                    view = {val.view}
                    
                    />
                )
            })}
            </div>
        </div>
    
  )
}

